import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { stuffAPI } from '../api/api';

function ItemList() {
  const [items, setItems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [loginStaff, setLoginStaff] = useState(null);
  const navigate = useNavigate();

  useEffect(() => {
    fetchItems();
  }, []);

  const fetchItems = async () => {
    try {
      const response = await stuffAPI.getItemList();
      // 서버에서 받은 데이터 구조 확인
      console.log('서버 응답:', response.data);
      
      // items가 배열인지 확인하고 설정
      const itemsData = response.data.items || [];
      setItems(Array.isArray(itemsData) ? itemsData : []);
      
      // 로그인 정보 설정
      setLoginStaff(response.data.loginStaff);
      setLoading(false);
    } catch (err) {
      console.error('에러 발생:', err);
      setError('물건 목록을 불러오는데 실패했습니다.');
      setLoading(false);
    }
  };

  const handleAddToCart = async (itemId, quantity) => {
    try {
      if (!loginStaff) {
        navigate('/login');
        return;
      }
      await stuffAPI.addToCart(itemId, quantity);
      alert('장바구니에 추가되었습니다.');
    } catch (err) {
      alert('장바구니 추가에 실패했습니다.');
    }
  };

  const handleDelete = async (itemId) => {
    if (window.confirm('정말 삭제하시겠습니까?')) {
      try {
        await stuffAPI.deleteItem(itemId);
        fetchItems(); // 목록 새로고침
      } catch (err) {
        alert('삭제에 실패했습니다.');
      }
    }
  };

  if (loading) return <div>로딩중...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div className="item-list">
      <h2>물건 목록</h2>
      
      {/* 로그인/로그아웃 버튼 */}
      <div className="auth-buttons">
        {loginStaff ? (
          <>
            <button onClick={() => navigate('/cart')}>장바구니</button>
            <button onClick={() => navigate(`/staff/edit/${loginStaff.bno}`)}>
              비밀번호 변경
            </button>
            <button onClick={() => staffAPI.logout()}>로그아웃</button>
          </>
        ) : (
          <button onClick={() => navigate('/login')}>로그인</button>
        )}
      </div>

      {/* 관리자 전용 버튼 */}
      {loginStaff?.admins === 1 && (
        <div className="admin-buttons">
          <button onClick={() => navigate('/staff/list')}>직원 관리</button>
        </div>
      )}

      <div className="items-grid">
        {items.map(item => (
          <div key={item.itemId} className="item-card">
            <h3>{item.itemName}</h3>
            <p>가격: {item.price}원</p>
            <p>재고: {item.stock}개</p>
            <input 
              type="number" 
              min="1" 
              max={item.stock} 
              defaultValue="1"
              onChange={(e) => {
                // 수량 변경 처리
              }}
            />
            <button onClick={() => handleAddToCart(item.itemId, 1)}>
              장바구니에 추가
            </button>
            
            {loginStaff?.admins === 1 && (
              <div className="admin-controls">
                <button onClick={() => navigate(`/edit/${item.itemId}`)}>
                  수정
                </button>
                <button onClick={() => handleDelete(item.itemId)}>
                  삭제
                </button>
              </div>
            )}
          </div>
        ))}
      </div>
    </div>
  );
}

export default ItemList;
